import React from "react";
import { Link, NavLink } from "react-router-dom";
import "./NavBar.css";
import { logo, close as closeIcon } from "../../assets";
import SearchBar from "../SearchBar";
import { SideBarContentProps } from "../SideBar/SideBar";

interface NavigationProps extends SideBarContentProps {
  disabled?: boolean;
  isOpen?: boolean;
}
const NavBar = ({ isOpen, onClose, ...props }: NavigationProps) => {
  return (
    <nav id="nav" {...props}>
      {isOpen && (
        <div className="nav-top">
          <button
            aria-controls="nav"
            autoFocus
            className="close-btn"
            onClick={onClose}
          >
            <img className="icon" src={closeIcon} alt="Close" />
          </button>
          <SearchBar />
          <Link to="/">
            <img className="logo" src={logo} alt="Logo" />
          </Link>
        </div>
      )}
      <ul>
        <li>
          <NavLink to="/">
            {({ isActive }) => (
              <span className={isActive ? "active" : ""}>Home</span>
            )}
          </NavLink>
        </li>
        <li>
          <NavLink to="/shop/category/men">
            {({ isActive }) => (
              <span className={isActive ? "active" : ""}>Men's</span>
            )}
          </NavLink>
        </li>
        <li>
          <NavLink to="/shop/category/women">
            {({ isActive }) => (
              <span className={isActive ? "active" : ""}>Women's</span>
            )}
          </NavLink>
        </li>
        <li>
          <NavLink to={"/kids"}>
            {({ isActive }) => (
              <span className={isActive ? "active" : ""}>Kids'</span>
            )}
          </NavLink>
        </li>
        <li>
          <NavLink to={"/new-arrivals"}>
            {({ isActive }) => (
              <span className={isActive ? "active" : ""}>New Arrivals</span>
            )}
          </NavLink>
        </li>

        <li>
          <NavLink to={"/releases"}>
            {({ isActive }) => (
              <span className={isActive ? "active" : ""}>Releases</span>
            )}
          </NavLink>
        </li>
      </ul>
    </nav>
  );
};

export default NavBar;
